INSERT INTO `kitchen` (`id`, `kitchen`, `description`) VALUES
(1, 'Русская', 'Традиционная кухня русского народа. Она сложилась под влиянием природных особенностей местности — обширных лесов и долгих зим.\r\n\r\nХарактерные особенности русской кухни:\r\n\r\n- разнообразие горячих супов и каш, квашений, мочений и солений, грибных блюд и дичи на русском столе;\r\n- центральная роль печи в русской избе;\r\n- важная роль домашнего хлеба (кислого ржаного), пирогов и пирожков;\r\n- использование одного из древнейших способов жаренья — пряжения (обжаривание в толстом слое масла).'),
(2, 'Грузинская', 'Рецепты грузинской кухни достаточно разнообразны. Среди них можно встретить приготовление нескольких видов сыров – брынзы, сулугуни, имеретинского, различные вариации национального супа харчо и популярного томатного супа, хачапури и ячмы с различными начинками, знаменитые грузинские соусы, вкуснейшие салаты, хинкали, закуски и выпечку. Для приготовления основных блюд можно использовать практически любое мясо: свинину, говядинку, курочку и баранину.\r\n\r\nОсновной отличительной чертой грузинской кухни считается присутствие практически во всех блюдах традиционного контрастного сочетания пикантного острого и интригующе пряного вкусов. Ни один салат, мясное блюдо или гарнир не подается без рубленной зелени. Широко используются овощи – помидоры, фасоль, баклажаны и пр. Часто добавляются грецкие орехи, чеснок и гранат.');

