INSERT INTO `recipe` (`id`, `name`, `description`, `image`, `kitchen_id`, `type_id`, `ingr`, `steps`, `created`) VALUES
(1, 'Борщ классический', 'Существует поговорка, что у каждой хозяйки — свой рецепт борща. Но если его нет — на помощь придет интернет. «Лента.ру» собрала лучшие рецепты приготовления борща: традиционного, с мясом на кости, постного борща с фасолью, диетического борща с курицей и летнего варианта — свекольника. А также узнала у диетолога, чем полезен этот суп и какой его вариант лучше выбрать.', , 1, 1, '{\"ingr\": [\"вода\", \"говядина\", \"свекла\", \"морковь\", \"лук репчатый\", \"подсолнечное масло\", \"лимонная кислота\", \"томатная паста\", \"капуста\", \"картофель\", \"чеснок\"]}', '{\"steps\": [\"Сварите бульон: налейте в кастрюлю воду, поместите туда мясо на кости (так борщ будет вкуснее) и поставьте на средний огонь. При закипании снимите пену. Затем накройте бульон крышкой и варите на медленном огне полтора часа.\", \"Подготовьте зажарку: вымойте свеклу, морковь и лук, очистите их, затем свеклу можно натереть на крупной терке, а морковь — на средней; лук нарежьте небольшими кубиками.\", \"Налейте в сковороду масло. Обжарьте свеклу, морковь и лук на медленном огне в течение пяти минут, затем добавьте лимонную кислоту, сок лимона или укусу. Так борщ станет красным и приобретет кислинку.\", \"Жарьте овощи еще пять минут, затем добавьте томатную пасту. Перемешайте и оставьте свеклу, морковь, лук репчатый и томат-пасту на медленном огне еще на пять минут.\", \"Начинайте собирать борщ. Достаньте из кастрюли мясо и оставьте остывать, в это время засыпьте в процеженный бульон нашинкованную капусту, добавьте картофель, нарезанный соломкой или кубиками.\", \"После этого нужно отделить мясо от кости, нарезать кубиками и вернуть в кастрюлю.\", \"Выложите в кастрюлю зажарку (свеклу, морковь, лук репчатый, томатную пасту) и перемешайте. Добавьте соль, перец черный молотый и другие приправы по вкусу, варите еще пять-семь минут.\", \"За пару минут до готовности добавьте зелень, немного измельченного чеснока или молотой гвоздики. Оставьте борщ настаиваться под крышкой в течение пяти- десяти минут.\", \"Борщ можно есть сразу после приготовления, но считается, что на следующий день он станет еще вкуснее. В тарелку можно добавить ложку сметаны или дольку лимона для легкой кислинки. К борщу обычно подают ржаной хлеб или пампушки с чесноком.\"]}', '2023-10-16 16:04:32');
INSERT INTO `recipe` (`id`, `name`, `description`, `image`, `kitchen_id`, `type_id`, `ingr`, `steps`, `created`) VALUES
(2, 'Куриный суп с клецками', 'Ароматный, легкий, при этом сытный - на обед для всей семьи! Суп с клецками на курином бульоне - один из моих самых любимых! Клецки, галушки, кнедли - так называют небольшие кусочки теста, готовятся они быстро из минимального набора продуктов. Такой супчик понравится всем - и взрослым, и детям.', , 1, 1, '{\"ingr\": [\"курица\", \"вода\", \"лук\", \"морковь\", \"картошка\", \"перец горошком\", \"лавровый лист\", \"растительное масло\", \"петрушка\", \"соль\", \"яйца\", \"пшеничная мука\", \"куриный бульон\"]}', '{\"steps\": [\"Как сделать суп с клецками на курином бульоне? Подготовьте продукты. Для бульона возьмите любые части курицы, кроме грудки, она слишком постная и суп из нее будет невкусным.\", \"Куриные части хорошо промойте под холодной водой, удалите лишний жир. Залейте курицу холодной чистой водой. Воду возьмите фильтрованную или бутилированную, от вкуса воды зависит вкус будущего бульона.\", \"Поставьте кастрюлю на средний огонь. Доведите до кипения, снимите шумовкой пену. Затем огонь сделайте минимальным. Бульон лучше варить при очень слабом кипении, чтобы он остался прозрачным. Накройте кастрюлю крышкой и оставьте бульон вариться на час. В конце варки добавьте соль, перец горошком и лавровый лист.\", \"Пока бульон варится, приготовьте тесто для клецок. Возьмите продукты по списку.\", \"Разбейте яйцо в небольшую миску, добавьте к нему соль и перец, перемешайте. Добавьте для начала две столовые ложки муки. Перемешайте. Добавьте растительное масло.\", \"Отлейте из кастрюли несколько ложек горячего бульона. Вылейте бульон в тесто при постоянном размешивании. От горячего бульона мука немного заварится и клецки будут воздушнее и вкуснее. Тесто станет довольно жидким. Добавляя муку, доведите его до нужной консистенции - тесто должно стать гуще, чем на оладьи.\", \"Хорошо вымытый и очищенный картофель нарежьте небольшими кусочками.\", \"Очищенный лук нарежьте кубиками.\", \"Вымытую и очищенную морковь натрите на крупной терке. Можете также нарезать ее соломкой, кружками, брусочками.\", \"Зелень петрушки хорошо промойте, обсушите и порубите.\", \"Сделайте зажарку для супа. На разогретую сковороду налейте немного масла. Выложите овощи. Жарьте их около 10 минут, изредка перемешивая, на среднем огне до мягкости.\", \"Бульон тем временем уже готов. Выньте из него курицу. Ее можно использовать по вашему усмотрению - или в другом блюде, или положив обратно в суп, предварительно отделив мясо от костей. Закиньте в бульон картофель. Накройте крышкой и варите 10 минут после закипания.\", \"Когда картофель будет готов, добавьте в суп зажарку.\", \"Дождитесь закипания супа и начните формировать клецки. Суп пусть активно кипит, огонь лучше прибавить, чтобы клецки быстрее заваривались. Одной чайной ложкой набирайте тесто, а другой аккуратно сталкивайте его в кастрюлю. Клецки сначала опустятся на дно, а затем всплывут.\", \"Как только клецки всплыли - они готовы. Добавьте в суп нарезанную петрушку, дождитесь закипания. Выключите нагрев, накройте кастрюлю крышкой и дайте супу настояться 10-15 минут.\", \"Люблю и часто готовлю такой суп. Он получается очень нежным на вкус. Мясо я добавляю порционно. Если клецки у вас получились слишком большими, разрежьте их прямо в кастрюле ножиком.\"]}', '2023-11-01 16:29:39');
INSERT INTO `recipe` (`id`, `name`, `description`, `image`, `kitchen_id`, `type_id`, `ingr`, `steps`, `created`) VALUES
(3, 'Солянка сборная мясная классическая', 'Вкуснее, чем в ресторане! Легко, просто, ярко, красиво! Классическая сборная мясная солянка делается из нескольких видов мяса и оставляет незабываемые впечатления. Ее можно подать для воскресного обеда и на праздничный стол. Будьте уверены - гости обязательно попросят добавки!', , 1, 1, '{\"ingr\": [\"ветчина\", \"копченая колбаса\", \"оливки\", \"корнишоны\", \"каперсы\", \"вода\", \"говядина\", \"копченые ребрышки\", \"лук\", \"лавровый лист\", \"душистый перец\", \"соль\", \"томатная паста\", \"растительное масло\", \"сливочное масло\", \"лимон\", \"сметана\", \"петрушка\"]}', '{\"steps\": [\"Как сварить классическую сборную мясную солянку? Начните с приготовления душистого бульона. Говядину берите с косточкой, но с достаточным количеством мяса. Подойдут говяжьи ребрышки, голяшка и другие части мяса. Копченые ребрышки могут быть свиные или говяжьи.\", \"В кастрюлю выложите говядину на косточке и копченые ребрышки. Залейте водой, поставьте на сильный огонь и доведите до кипения, снимая пену.\", \"Добавьте целую луковицу и варите на медленном огне 2 часа.\", \"За 15 минут до готовности слегка посолите, добавьте лавровые листья и горошины душистого перца.\", \"Пока варится мясо, подготовьте все остальные ингредиенты. Ветчину можете заменить на другое мясо: карбонад, свиную шейку, вареную колбасу и т. д. У меня колбаса сырокопченая, но можно и варенокопченую. Каперсы можете совсем не добавлять.\", \"Ветчину нарежьте соломкой.\", \"Колбасу нарежьте такой же соломкой.\", \"Корнишоны нарежьте соломкой. В солянку обычно добавляют соленые огурцы, но подойдут и маринованные. Если нет корнишонов, можете заменить их на обычные, понадобится 2 штуки.\", \"Из кастрюли выньте мясо. Луковицу, ребрышки, лавровый лист и перец выньте и выбросьте. Бульон процедите и верните на медленный огонь.\", \"Говядину охладите, отделите мясо от костей и нарежьте соломкой.\", \"В сковороду влейте 3 ст. л. бульона, выложите огурцы и потушите 5-7 минут. Переложите огурцы в кастрюлю с бульоном.\", \"Теперь приготовьте зажарку.\", \"Луковицу нарежьте мелкой соломкой. Для этого разрежьте луковицу пополам, каждую половину еще пополам. А четвертинки - соломкой.\", \"В освободившейся сковороде разогрейте сливочное и растительное масло. Обжарьте лук, помешивая, до золотистого цвета.\", \"Добавьте томатную пасту. Перемешайте и жарьте все вместе еще 1 минуту.\", \"Переложите зажарку в кастрюлю.\", \"Верните в кастрюлю измельченную говядину и копчености. Добавьте оливки и по желанию 50 мл рассола от них. Варите солянку еще 15 минут на медленном огне.\", \"В конце по желанию добавьте каперсы. Они вносят в солянку легкую островато-пикантную нотку, делая ее еще вкуснее. Суп перемешайте, посолите, поперчите по вкусу.\", \"Дайте солянке настояться под крышкой около 15 минут. Затем разлейте по тарелкам. В каждую тарелку добавьте ломтик лимона и зелень. Подавайте со сметаной. Приятного аппетита!\"]}', '2023-11-02 08:08:32');
INSERT INTO `recipe` (`id`, `name`, `description`, `image`, `kitchen_id`, `type_id`, `ingr`, `steps`, `created`) VALUES
(4, 'Щи из свежей капусты со свининой', 'Из простых продуктов, легко, просто, быстро и очень вкусно! Щи из свежей капусты со свининой всегда получаются вкусными, сытными и ароматными! Готовить их совсем несложно, у всех получится с первого раза. Отличное первое блюдо русской кухни!', , 1, 1, '{\"ingr\": [\"свинина\", \"капуста\", \"картошка\", \"лук\", \"морковь\", \"помидоры\", \"вода\", \"томатная паста\", \"растительное масло\", \"соль\", \"специи сухие\"]}', '{\"steps\": [\"Как сварить щи из свежей капусты со свининой? Подготовьте для этого все необходимое. Свинину можно использовать любую часть. Для первого блюда я всегда беру свинину на кости, чтобы бульон был наиболее наваристый.\", \"Свинину залейте водой, поставьте на огонь и доведите до кипения. При нагревании будет появляться пенка - её необходимо снять. Варите свинину в течение часа, чтобы мясо стало мягкое. Затем мясо отделите от кости и нарежьте на кусочки. Бульон процедите. Бульон с мясом верните на огонь и снова доведите до кипения.\", \"Картофель очистите, ополосните и нарежьте небольшими кусочками. Свежую капусту тонко нашинкуйте. Добавьте картофель и капусту в бульон к мясу и оставьте вариться на 15 минут.\", \"В это время займитесь овощной зажаркой. Лук и морковь очистите от кожуры и ополосните. Натрите морковь на терке, а лук мелко нарежьте. На горячую сковороду налейте немного растительного масла и обжарьте измельченные лук с морковью 2-3 минуты.\", \"Помидоры нарежьте кубиками и выложите в сковороду. Так же, добавьте совсем немного томатной пасты. Она придаст бульону приятный оттенок. Все вместе обжаривайте, помешивая, 3-5 минут. Затем выложите готовую зажарку в кастрюлю.\", \"Варите все вместе еще минут 10-15. По вкусу добавьте немного соли и специи. Готовые щи со свининой снимите с огня, накройте крышкой и дайте немного настояться.\", \"При подаче добавьте в тарелку немного свежей зелени. Приятного аппетита!\"]}', '2023-11-02 08:16:29');
INSERT INTO `recipe` (`id`, `name`, `description`, `image`, `kitchen_id`, `type_id`, `ingr`, `steps`, `created`) VALUES
(5, 'Гороховый суп с копчеными ребрышками классический', 'Наваристый, сытный, согревающий. Мужчины точно оценят! Гороховый суп с копченостями ребрышками классический - это идеальное сочетание ингредиентов, которое никого не оставляет равнодушным. Отлично подойдет для семейного обеда холодным зимним днем.', , 1, 1, '{\"ingr\": [\"горох\", \"копченые ребрышки\", \"вода\", \"лук\", \"морковь\", \"картошка\", \"растительное масло\", \"перец горошком\", \"лавровый лист\", \"соль\"]}', '{\"steps\": [\"Как сварить гороховый суп с копченостями ребрышками классический? Подготовьте все необходимые продукты. Горох берите колотый, он лучше и быстрее разваривается. Ребра лучше разрубить на небольшие куски. Воду для супа используйте хорошую, из фильтра или бутылки, от ее вкуса зависит вкус супа.\", \"Лук почистите. Одну луковицу отложите, ее будем варить целиком, вторую порежьте на мелкие кубики.\", \"Морковь хорошо помойте и почистите. Одну морковь оставьте целой для бульона, вторую натрите на крупной терке.\", \"Картошку помойте, очистите. Нарежьте клубни кубиками или брусочками. Залейте картошку водой, чтобы она не потемнела, пока варится суп.\", \"Возьмите большую кастрюлю, налейте в нее воду. Положите в нее ребра, предварительно хорошо помыв их. Горох промойте под проточной водой до прозрачной воды. Добавьте горох в кастрюлю к ребрам. Как выбрать кастрюлю для супа читайте в статье в конце рецепта.\", \"Поставьте кастрюлю на плиту на средний огонь. Дождитесь закипания, снимите шумовкой пену. Убавьте огонь и оставьте бульон вариться на один час.\", \"Через час горох уже хорошо разварится. Положите в суп оставленные целыми луковицу и морковь. Добавьте соль. Учтите, что ребра соленые, они отдадут часть соли бульону, поэтому дополнительно солить надо меньше или не надо вовсе. Оставьте суп вариться еще на полчаса.\", \"Пока суп доваривается, сделайте зажарку из овощей. Для этого разогрейте в сковороду, налейте на нее растительное масло. Выложите лук и морковь. Жарьте овощи на небольшом огне, перемешивая их, до золотистого цвета.\", \"Через полчаса выньте из супа луковицу и морковь, они нам больше не понадобятся. Положите нарезанный картофель. Варите картофель до готовности.\", \"Добавьте в суп зажарку, положите в него перец горошком и лавровый лист. Дождитесь закипания супа, прокипятите его пару минут. Затем огонь выключите, накройте кастрюлю крышкой и дайте гороховому супу с копчеными свиными ребрышками немного настояться и подавайте к столу.\"]}', '2023-11-02 08:23:57');
INSERT INTO `recipe` (`id`, `name`, `description`, `image`, `kitchen_id`, `type_id`, `ingr`, `steps`, `created`) VALUES
(6, 'Рассольник со свининой и перловкой', 'Наваристый, сытный, ароматный, бесподобно вкусный! Рассольник со свининой и перловкой - это отличное первое блюло для всей семьи на каждый день. Аппетитный и вкусный, такой суп мало кого оставит равнодушным. Он придётся по вкусу и взрослым, и детям.', , 1, 1, '{\"ingr\": [\"свинина\", \"картошка\", \"перловка\", \"морковь\", \"лук\", \"соленые огурцы\", \"рассол\", \"томатная паста\", \"растительное масло\", \"зелень\", \"лавровый лист\", \"перец горошком\", \"соль\"]}', '{\"steps\": [\"Какси варить рассольник со свининой и перловкой? Подготовьте необходимые продукты. Мясо лучше берите на кости, не слишком постное, бульон тогда получится вкуснее и насыщеннее. Огурцы для рассольника лучше всего подходят соленые, не маринованные. Но их сейчас не так легко найти. Возьмите тогда домашнего посола, не магазинные, в них не так много уксуса.\", \"Перловку хорошо промойте под проточной холодной водой, до тех пор, пока вода не станет прозрачной. Уберите из нее мусор. Залейте крупу на 30 минут холодной водой.\", \"Мясо положите в кастрюлю с холодной чистой водой. Используйте фильтрованную или бутилированную воду, так как от ее вкуса будет зависеть вкус супа. У меня кастрюля 4-х литровая. Поставьте кастрюлю на средний огонь.\", \"Дождитесь закипания воды, снимите шумовкой образовавшуюся пену. Если упустить этот момент, то бульон станет мутным и некрасивым. Огонь сделайте минимальным, накройте кастрюлю крышкой. Варите бульон с мясом в общей сложности 1,5 часа.\", \"Через полчаса варки бульона закиньте в него перловку. Предварительно слейте с нее воду, в которой она замачивалась. Добавьте соль. Положите для начала небольшое количество, чтобы не пересолить, так как мы вольем стакан соленого рассола. Оставьте бульон вариться дальше, уже с перловкой.\", \"Пока бульон варится, подготовьте овощи. Очищенный лук нарежьте на небольшие кубики.\", \"Морковь хорошо помойте и очистите. Натрите ее на крупной терке.\", \"Огурцы также натрите на терке. Я предпочитаю именно натирать их, а не резать. Так получается и красивее, и вкуснее.\", \"Картофель помойте, почистите и нарежьте на средние кусочки.\", \"Зелень промойте и обсушите при помощи бумажного или простого полотенца. Нарежьте ее.\", \"Сделайте зажарку. На сковороду налейте растительное масло. Выложите лук и морковь. Обжаривайте их несколько минут, периодически перемешивая.\", \"Добавьте к овощам огурцы. Влейте стакан рассола. Перемешайте и немного потушите овощи. я накрываю сковороду крышкой и тушу их на маленьком огне около 10 минут. Огурцы за счет того, что они натерты, быстро станут мягкими.\", \"Добавьте в зажарку томатную пасту, перемешайте. Жарьте овощи уже без крышки до полного испарения жидкости.\", \"За 15 минут до конца варки бульона выньте мясо, оно уже успеет свариться. Положите в бульон картофель. Мясо немного остудите, а затем нарежьте небольшими кусочками. Верните мясо назад в бульон.\", \"Когда картофель сварится (примерно через 10 минут после его закладки), добавьте в суп зажарку. Дождитесь закипания и проварите суп ещё примерно 5 минут.\", \"Положите лавровый лист, перец горошком и нарезанную зелень. Снова дождитесь закипания и выключите огонь. Накройте кастрюлю крышкой и дайте супу настояться 15 минут. При подаче добавьте в порцию ложку сметаны. Приятного аппетита!\"]}', '2023-11-02 08:31:29');
INSERT INTO `recipe` (`id`, `name`, `description`, `image`, `kitchen_id`, `type_id`, `ingr`, `steps`, `created`) VALUES
(7, 'Суп харчо из свинины с рисом', 'Густой, насыщенный, очень вкусный, семье на обед! Классический суп Харчо из свинины с рисом и картошкой - это отличное первое блюдо для повседневного меню. Варить его можно на любом мясе, а набор специй использовать на свой вкус. Без перца этот суп можно давать даже маленьким детям.', , 2, 1, '{\"ingr\": [\"свинина\", \"картошка\", \"рис\", \"лук\", \"помидоры\", \"чеснок\", \"томатная паста\", \"вода\", \"растительное масло\", \"лавровый лист\", \"зелень\", \"хмели-сунели\", \"соль\", \"перец черный молотый\"]}', '{\"steps\": [\"Как сварить классический суп Харчо из свинины с рисом и картошкой? Подготовьте для этого необходимые ингредиенты. Свинину для варки бульона выбирайте на кости. Бульон получится наиболее наваристый. Картофель заранее очистите от кожуры. Промойте рис.\", \"Свинину залейте водой, поставьте на огонь и доведите до кипения. При закипании будет появляться пенка - её необходимо снять. Проварите мясо 1-1,5 часа до мягкости. Затем отделите мясо от костей, нарежьте на кусочки и верните в процеженный бульон. Вместо свинины можете использовать любое другое мясо.\", \"В кипящий бульон добавьте картофель, нарезанный на кусочки.\", \"Следом отправьте рис. Варите все вместе минут 15.\", \"В это время очистите лук и мелко его нарежьте. На горячую сковороду налейте немного растительного масла и выложите лук. Обжаривайте его в течение минуты до прозрачности.\", \"Затем добавьте в сковороду мелко нарезанные помидоры и томатную пасту. Всыпьте все подготовленные специи. Именно они зададут основной вкус готового супа. Кстати, помидоры можно измельчите до состояния пюре или сделать как у меня. Перемешайте. Обжаривайте все вместе еще 2-3 минуты.\", \"Готовую зажарку отправьте в кастрюлю к супу. Попробуйте на вкус. Если помидоры и томатная паста кисловаты, то можно добавить 0,5 столовой ложки сахара. По вкусу добавьте соль и молотый перец. Опустите в кастрюлю лавровый лист.\", \"Проварите все вместе еще минут 5-7 и снимите кастрюлю с огня. Добавьте немного измельченной зелени. Готовый классический суп Харчо из свинины с рисом и картофелем разлейте по тарелкам и подавайте к столу в горячем виде. Приятного аппетита!\"]}', '2023-11-02 08:37:30');
INSERT INTO `recipe` (`id`, `name`, `description`, `image`, `kitchen_id`, `type_id`, `ingr`, `steps`, `created`) VALUES
(8, 'Салат с красной фасолью и говядиной', 'Вкусный, пикантный, быстрый, на каждый день! Салат с красной фасолью и говядиной представитель грузинской кухни, а значит точно будет остро и сытно. Иногда его можно встретить под названием \"Тбилиси\". Особенно оценит состав продуктов мужская часть семьи.', , 2, 2, '{\"ingr\": [\"говядина\", \"фасоль\", \"болгарский перец\", \"грецкие орехи\", \"зелень\", \"чеснок\", \"растительное масло\", \"винный уксус\", \"хмели-сунели\", \"соль\"]}', '{\"steps\": [\"Как сделать салат с красной фасолью и говядиной? Возьмите указанные ингредиенты.\", \"Консервированную фасоль откройте, слейте жидкость, промойте под проточной водой и выложите подготовленную фасоль в глубокую посуду для салата. При желании вы можете самостоятельно отварить заранее замоченную, примерно на 12 часов фасоль. Варите фасоль до готовности от 30 минут до 1,5 часов, в зависимости от ее сорта.\", \"Возьмите фиолетовый лук, очистите от шелухи, сполосните, обсушите, нарежьте полукольцами. Положите в миску с фасолью. Вы можете взять и обычный репчатый лук.\", \"Красный болгарский перец промойте, обсушите, удалите плодоножку и семена. Нарежьте полосками и положите в миску к подготовленным ранее ингредиентам. Вы можете взять болгарский перец любого цвета, я взяла красный. Для остроты вкуса, по желанию, можно добавить 1/4 стручка острого перца или перец чили. Нарежьте его тоненькими полосками. Работать с острым перцем лучше в перчатках, так как он может обжечь кожу рук и вызвать жжение.\", \"Зубчики чеснока очистите, пропустите через пресс или порежьте очень мелко ножом. Добавьте в салат.\", \"Заранее отварите говядину. Холодную отварную говядину нарежьте тонкими полосками. Добавьте в миску с другими нарезанными ингредиентами.\", \"Грецкие орехи прогрейте на сухой сковороде (обжаренные орехи лучше раскрывают свой аромат). Порубите их ножом и добавьте в салат. Отставьте миску с салатом, теперь займемся заправкой.\", \"Как сделать заправку для салата? Для этого смешайте растительное масло, винный уксус, хмели-сунели и соль. Перемешайте. Можете взять любое растительное масло подсолнечное или оливковое, выбирайте на ваш вкус. Уксус можно заменить обычным столовым уксусом. Специи также можете подобрать на свой вкус.\", \"Залейте заправкой салат, перемешайте. Добавьте свежую зелень петрушки или кинзы. Перед подачей рекомендуется дать салату немного постоять в холодильнике.\"]}', '2023-11-02 08:42:30');
INSERT INTO `recipe` (`id`, `name`, `description`, `image`, `kitchen_id`, `type_id`, `ingr`, `steps`, `created`) VALUES
(9, 'Хаш из говядины', 'Этот суп зарядит организм энергией и силами на целый день! Раньше хаш называли едой бедняков. По легенде, царь хорошее мясо оставлял себе, а кости выбрасывал в ущелье, где жил пастух Хаш. Царю так понравился аромат похлёбки пастуха, что он пригласил к себе бедняка и приказал сварить кости. После этого царь кости оставлял себе, а мясо раздавал беднякам', , 2, 1, '{\"ingr\": [\"голяшки говяжьи\", \"вода\", \"зелень\", \"чеснок\", \"столовый уксус\", \"редька\", \"растительное масло\", \"рассольный сыр\", \"лаваш тонкий\"]}', '{\"steps\": [\"Вот главный ингредиент для хаша - говяжьи ноги, а точнее в моем случае - это коленные суставы. Для хаша также берут говяжьи хвосты и требуху, а именно рубец, но если вы решитесь на этот ингредиент, то его нужно будет предварительно вымочить и отваривать отдельно, а только потом добавлять в общую кастрюлю.\", \"Ноги нужно разрубить так, чтобы они поместились в кастрюлю, хорошо помыть и замочить на 6-8 часов, меняя несколько раз воду. Я замачивала на ночь\", \"Прежде, чем ставить хаш варить, все еще раз хорошо моем и меняем в последний раз воду\", \"Доводим до кипения и снимаем пену, а затем убавляем огонь до самого минимального и практически забываем про него на 8 часов. Я только изредка снимала пену и следила, чтобы бульон сильно не кипел\", \"Через 8 часов у нас вот такой ароматный наваристый бульон. По классике в кастрюлю с хашем не добавляется ни соль, ни другие специи\", \"Аккуратно, чтобы не обжечься, извлекаем кости из бульона\", \"Отделяем мясо от кости\", \"Бульон обязательно процеживаем через сито, чтобы избавиться от мелких осколков костей\", \"В отдельную пиалу выдавливаем головку чеснока\", \"Заливаем 1-2 половниками горячего бульона и добавляем 1-2 стол. л. уксуса, солим - это будет заправка к хашу\", \"К хашу традиционно подают редьку, тертую или нарезанную кусочками\", \"Заправляю редьку растительным маслом и присаливают\", \"Также, с хашем на столе должен быть нарезанный рассольный сыр\", \"Тонкий армянский лаваш режут небольшими квадратиками и подсушивают\", \"Измельчаем зелень\", \"В тарелку кладем кусочки мяса, заливаем очень горячим бульоном, солим, добавляем чесночную заправку и едим вприкуску с лавашом или же кладем его прямо в тарелку и даем ему немного размокнуть\", \"Уверена, вы точно оцените это блюдо! Приятного аппетита!\"]}', '2023-11-02 08:49:34');
INSERT INTO `recipe` (`id`, `name`, `description`, `image`, `kitchen_id`, `type_id`, `ingr`, `steps`, `created`) VALUES
(10, 'Лобио из красной фасоли', 'Вкусный, питательный, постный, на любой случай. Салат лобио из красной фасоли по мотивам классического рецепта грузинской кухни порадует любителей здорового и полезного питания. Он готовится быстро и просто, если за основу взять консервированную фасоль.', , 2, 2, '{\"ingr\": [\"фасоль красная\", \"грецкие орехи\", \"болгарский перец\", \"чеснок\", \"кинза\", \"лавровый лист\", \"подсолнечное масло\", \"хмели-сунели\", \"перец чили\", \"соль\"]}', '{\"steps\": [\"Как сделать салат лобио из красной фасоли? Подготовьте все необходимые ингредиенты. Вместо свежей фасоли можно использовать консервированную.\", \"Красную фасоль переберите, промойте. Залейте фасоль холодной водой и оставьте на ночь.\", \"Воду слейте, а фасоль выложите в кастрюлю. Залейте фасоль свежей водой, поставьте на огонь и варите до готовности. В конце добавьте соль по вкусу.\", \"Готовую фасоль откиньте на дуршлаг и обсушите.\", \"Болгарский перец помойте и нарежьте соломкой.\", \"Грецкие орехи измельчите ножом.\", \"Чеснок очистите и мелко нарежьте.\", \"Кинзу вымойте, обсушите и также мелко нарежьте.\", \"В сковороде разогрейте растительное масло. Выложите болгарский перец, чеснок и щепотку соли. Обжарьте всё вместе в течение 3-4 минут.\", \"Добавьте болгарскому перцу хмели-сунели, острый перец, лавровый лист и щепотку черного перца. Потушите все вместе, помешивая, около 5 минут.\", \"Добавьте в сковороду фасоль, грецкие орехи, кинзу и всё перемешайте.\", \"Потушите лобио еще 2 минуты, после чего уберите сковороду с огня.\", \"Разложите лобио по тарелкам и подавайте к столу. Такой салат хорош как в теплом, так и в холодном виде. Приятного аппетита!\"]}', '2023-11-02 09:00:04');
INSERT INTO `recipe` (`id`, `name`, `description`, `image`, `kitchen_id`, `type_id`, `ingr`, `steps`, `created`) VALUES
(11, 'Салат батумский', 'Легкий овощной салат с изумительный грузинской заправкой. Салат из помидоров, огурцов и болгарского перца с зеленью не является для нас чем-то особенным. Грузинский колорит придает ему пикантная заправка из грецких орехов с кинзой.', , 2, 2, '{\"ingr\": [\"помидоры  черри\", \"огурцы\", \"болгарский перец\", \"петрушка\", \"вода\", \"грецкие орехи\", \"кинза\", \"чеснок\", \"хмели-сунели\", \"соль\", \"перец чили\"]}', '{\"steps\": [\"Для салата нам понадобится: 200 г помидоров черри; 1 огурец; 1 болгарский перец; 3-4 веточки петрушки.\", \"Огурец вымыть, обсушить и нарезать полукольцами.\", \"Болгарский перец очистить от семян и плодоножки и нарезать соломкой.\", \"Помидоры черри вымыть, обсушить и разрезать пополам.\", \"Петрушку вымыть, обсушить и мелко порубить.\", \"В салатнике соединить помидоры черри, огурцы, болгарский перец и петрушку. Все перемешать.\", \"Для приготовления ореховой заправки для салата нам понадобится: 80 мл воды; 50 г ядер грецких орехов; 5 веточек кинзы; 2 зубчика чеснока; ½ ч. л. хмели-сунели; ½ ч. л. соли и перец чили на кончике ножа.\", \"Чеснок очистить и порубить ножом на крупные кусочки. Можно вовсе добавить чеснок целыми зубчиками. Все равно соус получится однородный.\", \"В чашу блендера или комбайна выложить кинзу, ядра грецких орехов, всыпать хмели-сунели, чеснок, соль и перец чили. Влить воду.\", \"Все тщательно измельчить практически до однородности с помощью насадки на нож.\", \"На сервировочное блюдо горкой выложить салат.\", \"Полить салат ореховой заправкой. И можно подавать к столу. Приятного аппетита!\"]}', '2023-11-02 09:06:21');

